/// Returns a reference to the value corresponding to the supplied key.
///
/// # Panics
///
/// Panics if the key is not present in the `HashMap`.
///
/// # Examples
///
/// ```
/// use hashbrown::HashMap;
///
/// let map: HashMap<_, _> = [("a", "One"), ("b", "Two")].into();
///
/// assert_eq!(map[&"a"], "One");
/// assert_eq!(map[&"b"], "Two");
/// ```
